import React, { Component } from 'react';
const Background = ({child1, child2}) => {
    return (  
        <div style={{backgroundColor:"#2A3E4C"}}>
            <div>{child1}</div>
            <div>{child2}</div>
        </div>
    );
}
 
export default Background;
